import React from "react";
import Bottom from "../Home/Bottom/Bottom";
// import Filter from "../Catalog/Filter/Catalog.filter";
import '../Catalog/Filter/Catalog.filter.css'
import '../Catalog/Card/Catalog.Cards.css'
import Cards from "../Catalog/Card/Catalog.Cards";
import '../Catalog/Header/CatalogHeader.css'
import CatalogHeader from "./Header/CatalogHeader";
import CatalogShoes from "../Catalog/Filter/Catalog.filter";





function Catalog() {

    return (
        <div>
            <CatalogHeader/>
            <CatalogShoes/>
            <Cards/>
            <Bottom/>


        </div>
    )
}

export default Catalog;
